$(function () {
    answers = null;
    var id = $("#hfID").val();
    if (id != "") {
        loadquestiondata(id);
    }
    imgManage();
})
var index = 0;
var interval;
var timeout_next;
var timeout_title;
var timeout_answer;
var timeout_result;
var right_answer;
var answers;
var myresult = "{}"; //所有的答案情况，为后面保存准备数据，数据格式为json;
var _myresult = "";
var starttimestamp;
var audio;
function loadquestiondata(id) {
    $.ajax({
        url: "../provide/answer.ashx",
        type: "POST",
        dataType: "json",
        async: false,
        data: "id=" + id + "&openid=" + $("#hfOpenID").val().replace(/\+/g, '%2B') + "&method=getquesstion",
        beforeSend: function () {
            chanage_audio(gamemusic.ready);
        },
        complete: function () {

        },
        success: function (data) {
            console.log("b");
            console.log(data);

            if (!jQuery.isEmptyObject(data)) {
                $("#prepare").show();
                $("#prepare img").addClass("transition_show");
                setTimeout(function () {
                    $("#prepare").hide();
                    var audiobg = document.getElementById('gamemusicbg');
                    if (audiobg != null) {
                        audiobg.src = gamemusic.start();
                        audiobg.play();
                    }
                    audio = document.getElementById('audio');
                    audio.pause();
                    audio.startTime = 0;
                    answers = data;
                    myresult = "{\"openid\":\"" + $("#hfOpenID").val().replace(/\+/g, '%2B') + "\",\"questionactiveid\":\"" + $("#hfID").val() + "\",\"detail\":[@]}";
                    _myresult = "";
                    index = 0;
                    $("#time").text("10");
                    catchdata(data);
                }, 2000);
            }
        }
    })
}
function catchdata(data) {
    
    $("#accessory_img").hide();
    if (index + 1 > data.length) {
        clearTimeout(timeout_next);
        clearTimeout(timeout_title);
        clearTimeout(timeout_answer);
        clearTimeout(timeout_result);
        audio.pause();
        audio.startTime = 0;
       
        var length = _myresult.length
        var s = _myresult.substr(length - 1, 1);
        console.log("c");
        console.log(s);
        if (s == ",") {
            _myresult = _myresult.substr(0, length - 1);
        }
        myresult = myresult.replace("@", _myresult);
        
        if (myresult.length != 0) {
            submitscore();
        }
    } else {
        //控制第几轮
        if (index + 1 > data.length) {
            $("#sn").text(index);
        } else {
            $("#sn").text(index + 1);
        }
        
        //$("#next").show();
        chanage_audio(gamemusic.transition);
        $("#currlabel").text(index + 1 + " / " + data.length);
        timeout_next = setTimeout(function () { //转场切换题目
            //$("#next").hide();
            initanswer(data[index]);
            $("#title").html(data[index].TestQuestion);
            timeout_title = setTimeout(function () { //先显示题目后显示等先答案
                var sn = 10;
                interval = setInterval(function () {
                    $("#time").text(sn);
                    sn -= 1;
                }, 1000);
                $("#answer").show(500);
                starttimestamp = new Date().getTime();
                timeout_answer = setTimeout(function () {//答题时间
                    
                    clearInterval(interval);
                    $("#time").text("");
                    $("#answer").hide();
                    $("#title").html("");
                    $("#accessory_img").removeAttr("src");
                    audio.pause();
                    audio.startTime = 0;
                    catchdata(data);
                }, 11000);
                index += 1;
            }, 5); //1000
        }, 20); //2000
    }
}
function formatAnswer(data) {
    return data.substr(0, data.length - 2);
}
function takeAnswer(data) {
    var length = data.length;
    return data.substr(length - 1, 1);
}
//初始化
function initanswer(item) {
    $("#btnA").text(formatAnswer(item.Answer1));
    $("#btnB").text(formatAnswer(item.Answer2));
    $("#btnC").text(formatAnswer(item.Answer3));
    $("#btnD").text(formatAnswer(item.Answer4));
    $("#time").text("10");
   
    right_answer = item.RightAnswer;
    
    $("#btnA").css({ "color": "#000" });
    $("#btnB").css({ "color": "#000" });
    $("#btnC").css({ "color": "#000" });
    $("#btnD").css({ "color": "#000" });
    $("#answerright").css({ "display": "none" });
    $("#answererror").css({ "display": "none" });
    $("#answerright img").css({ "width": "100%;", "height": "100%" });
    $("#answererror img").css({ "width": "100%;", "height": "100%" });
    $("#answer").hide();
    $("#accessory_img").hide();
    audio.pause();
    audio.startTime = 0;
    $("#accessory_img").removeAttr("src");
    $("#answer span").removeClass("half");
    $("#answer span").css("float", "none");
    

    if (item.QuestionType == "2" || item.QuestionType == "4") {
        $("#answer span").addClass("half");
        $("#answer span:odd").css({ "float": "left" });
        $("#answer span:even").css({ "float": "right" });

        if (item.QuestionType == "2") {
            $("#accessory_img").attr("src", item.AccessoryUrl);
            
            $("#accessory_img").show();
        }
        if (item.QuestionType == "4") {
            
        }
    } else if (item.QuestionType == "3") {
        audio = document.getElementById('audio');
        if (audio != null && audio.canPlayType && audio.canPlayType("audio/mpeg")) {
            audio.src = item.AccessoryUrl;
            audio.play();
        }
    } else {
        
    }
}
//答题时发生的动作
function answerquestion(v, id) {
    clearInterval(interval);
    clearTimeout(timeout_answer);
    $("#time").text("");
    audio.pause();
    audio.startTime = 0;
    var endtimestamp = new Date().getTime();
    var timestamp = endtimestamp - starttimestamp;
    if (v.toLocaleLowerCase() == right_answer.toLocaleLowerCase()) {//答对
        chanage_audio(gamemusic.right); 
        answerTextColor(v.toLocaleLowerCase(), "#8ddb47")
        answeranimate(id, "answerright");
        addscore(answers[index-1].Score);
        setmyresult(timestamp,1,v);
    } else { //答错
        chanage_audio(gamemusic.error); 
        answerTextColor(v.toLocaleLowerCase(), "#d9393b")
        answeranimate(id, "answererror");
        showrightanswer("#8ddb47");
        //setmyresult(timestamp, 0,v);
    }
    timeout_result = setTimeout(function () { //答完题后，停留时间显示结果
        $("#time").text("");
        $("#answer").hide();
        $("#title").html("");
        $("#accessory_img").removeAttr("src");
        audio.pause();
        audio.startTime = 0;
        catchdata(answers);
    }, 1000);//2000
}
//显示答对答错是按钮颜色
function answerTextColor(v, color) {
    if (v == "a") {
        $("#btnA").css({ "color": color });
    } else if (v == "b") {
        $("#btnB").css({ "color": color });
    }
    else if (v == "c") {
        $("#btnC").css({ "color": color });
    }
    else if (v == "d") {
        $("#btnD").css({ "color": color });
    }
}
//当答题出错时，显示正确的答案
function showrightanswer(color) {
    if (right_answer.toLocaleLowerCase() == "a") {
        $("#btnA").css({ "color": color });
    } else if (right_answer.toLocaleLowerCase() == "b") {
        $("#btnB").css({ "color": color })
    } else if (right_answer.toLocaleLowerCase() == "c") {
        $("#btnC").css({ "color": color });
    } else if (right_answer.toLocaleLowerCase() == "d") {
        $("#btnD").css({ "color": color });
    }
}
//显示答对答错的图标
function answeranimate(id, animateid) {
    var left = $("#" + id).position().left + 'px';
    var top = $("#" + id).position().top + 'px';
    $("#" + animateid).css({ "display": "block" });
    $("#" + animateid + " img").animate({
        left: left,
        top: top,
        opacity: '1',
        height: '40px',
        width: '40px'
    }, "slow");
}
//拼接答案json
function setmyresult(timestamp,right,select) {
    var i = index - 1;
    _myresult += "{\"testquestion\":" + answers[i].ID + ",\"score\":" + answers[i].Score + ",\"usingtime\":" + timestamp + ",\"right\":" + right + ",\"select\":\"" + select + "\"},";
}
//提交成绩
function submitscore() {
    $.ajax({
        //url: "../provide/answer.ashx",
        url: "/App/Project/Gxdr/Controller/ResultController.ashx?method=result",
        type: "POST",
        dataType: "JSON",
        async: true,
        data: "json=" + myresult,
        success: function (data) {
            console.log("a");
            console.log(data);
            if (!jQuery.isEmptyObject(data)) {
                console.log("开始提交数据");
                window.location.href = "ShowResult.aspx?openid=" + data.openId + "&score=" + data.score + "&activityid=" + data.activeId + "&upgrade=" + data.grade + "&isgetgold=" + data.gold + "&weixinid=" + $("#hfWeiXinID").val() + "&detail=" + data.detail;
            } else {
                window.location.href = "result.aspx?activityid=" + $("#hfID").val();
            }
        },error(a,b,c){
            console.log(a);
        }
    });
}
function chanage_audio(audiopath) {
    audio = document.getElementById('audio');
    this.play = function () {
        if (audio != null) {
            audio.src = audiopath;
            audio.play();
        }
    }
    if ((navigator.userAgent.match(/iPhone/i) || navigator.userAgent.match(/iPod/i))) {
        // 判断系统版本号是否大于 4
        var t = Boolean(navigator.userAgent.match(/OS [8-9]_\d[_\d]* like Mac OS X/i));
        if (t == true) {
            this.play();
        }
    } else {
        this.play();
    }
}
